/*Table structure for table `dossier` */

DROP TABLE IF EXISTS `dossier`;

CREATE TABLE `dossier` (
  `id` varchar(20) NOT NULL,
  `date_dossier` date NOT NULL COMMENT 'date du jour ou est constitue le dossier',
  `ref_patient` int(10) unsigned NOT NULL,
  `prix_total` decimal(12,3) unsigned DEFAULT NULL,
  `valide` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `reste_a_payer` decimal(12,3) unsigned DEFAULT NULL,
  `nbre_examen` int(11) DEFAULT '0',
  `soumis` bit(1) DEFAULT b'0',
  PRIMARY KEY (`id`),
  KEY `ref_patient` (`ref_patient`),
  CONSTRAINT `dossier_ibfk_1` FOREIGN KEY (`ref_patient`) REFERENCES `patient` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

