DROP TABLE IF EXISTS `dossier_formulaire`;

CREATE TABLE `dossier_formulaire` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `nbre_examen` int(11) NOT NULL,
  `fichier` longtext CHARACTER SET cp866 NOT NULL,
  `valide` tinyint(1) NOT NULL,
  `date_create` datetime NOT NULL,
  `user_create` varchar(150) CHARACTER SET cp866 NOT NULL,
  `date_maj` datetime NOT NULL,
  `user_maj` varchar(150) CHARACTER SET cp866 NOT NULL,
  `version` int(11) NOT NULL,
  `ref_dossier` varchar(20) NOT NULL,
  `enregistre` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `ref_dossier` (`ref_dossier`),
  CONSTRAINT `dossier_formulaire_ibfk_1` FOREIGN KEY (`ref_dossier`) REFERENCES `dossier` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=latin1;

