/*Table structure for table `ecriture` */

DROP TABLE IF EXISTS `ecriture`;

CREATE TABLE `ecriture` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `ref_compte` int(10) unsigned DEFAULT NULL,
  `date_operation` datetime NOT NULL,
  `sens` varchar(8) NOT NULL,
  `motif` varchar(300) DEFAULT NULL,
  `montant` decimal(12,3) NOT NULL,
  `valide` tinyint(1) NOT NULL DEFAULT '1',
  `solde` decimal(12,3) DEFAULT NULL,
  `checked` tinyint(1) DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `ref_compte` (`ref_compte`),
  CONSTRAINT `ecriture_ibfk_1` FOREIGN KEY (`ref_compte`) REFERENCES `compte` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `ecriture` */

/*Table structure for table `employe` */

DROP TABLE IF EXISTS `employe`;

CREATE TABLE `employe` (
  `id` int(10) unsigned NOT NULL,
  `date_naissance` date NOT NULL,
  `date_recrutement` char(4) NOT NULL,
  `heure_sup` smallint(5) unsigned NOT NULL DEFAULT '0',
  `categorie` varchar(20) NOT NULL,
  `echelon` varchar(20) NOT NULL,
  `base` decimal(12,3) NOT NULL DEFAULT '0.000',
  `prime_anciennete` decimal(12,3) NOT NULL DEFAULT '0.000',
  `prime_risque` decimal(12,3) NOT NULL DEFAULT '0.000',
  `prime_technicite` decimal(12,3) NOT NULL DEFAULT '0.000',
  `prime_rendement` decimal(12,3) NOT NULL DEFAULT '0.000',
  `prime_assiduite` decimal(12,3) NOT NULL DEFAULT '0.000',
  `indemnite_resp` decimal(12,3) NOT NULL DEFAULT '0.000',
  `indemnite_forfaitaire` decimal(12,3) NOT NULL DEFAULT '0.000',
  `acompte` decimal(12,3) NOT NULL DEFAULT '0.000',
  `retenue_elec` decimal(12,3) NOT NULL DEFAULT '0.000',
  `avance_ex` decimal(12,3) NOT NULL DEFAULT '0.000' COMMENT 'avance sur salaire',
  `autre` decimal(12,3) NOT NULL DEFAULT '0.000' COMMENT 'autres retenues',
  `syndic` decimal(12,3) NOT NULL DEFAULT '0.000',
  `assurance` decimal(12,3) NOT NULL DEFAULT '0.000',
  `qualification` varchar(45) NOT NULL,
  `matricule_cnps` varchar(10) NOT NULL,
  `salaire_horaire` decimal(12,3) NOT NULL DEFAULT '0.000',
  `forfait_heure_sup` decimal(12,3) NOT NULL DEFAULT '0.000',
  `sit_fam` varchar(20) DEFAULT NULL,
  `salaire_brute` decimal(12,3) NOT NULL DEFAULT '0.000',
  `irpp` decimal(12,3) NOT NULL DEFAULT '0.000',
  `date_modification` datetime DEFAULT NULL,
  `CNPS` decimal(12,3) NOT NULL DEFAULT '0.000',
  `CAC` decimal(12,3) NOT NULL DEFAULT '0.000',
  `CCF` decimal(12,3) NOT NULL DEFAULT '0.000',
  `prime_logement` decimal(12,3) NOT NULL DEFAULT '0.000',
  `prime_caisse` decimal(12,3) NOT NULL DEFAULT '0.000',
  `prime_autre` decimal(12,3) NOT NULL DEFAULT '0.000',
  PRIMARY KEY (`id`) USING BTREE,
  CONSTRAINT `employe_ibfk_1` FOREIGN KEY (`id`) REFERENCES `personne` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `employe` */

/*Table structure for table `envoie` */

DROP TABLE IF EXISTS `envoie`;

CREATE TABLE `envoie` (
  `ref_prescripteur` int(10) unsigned NOT NULL,
  `ref_dossier` varchar(7) NOT NULL,
  `date_envoie` date NOT NULL,
  `pourcentage` decimal(4,2) DEFAULT '0.00',
  PRIMARY KEY (`ref_prescripteur`,`ref_dossier`),
  KEY `ref_dossier` (`ref_dossier`),
  CONSTRAINT `envoie_ibfk_1` FOREIGN KEY (`ref_prescripteur`) REFERENCES `prescripteur` (`id`),
  CONSTRAINT `envoie_ibfk_2` FOREIGN KEY (`ref_dossier`) REFERENCES `dossier` (`id`)
