/*Table structure for table `prescripteurjour` */

DROP TABLE IF EXISTS `prescripteurjour`;

CREATE TABLE `prescripteurjour` (
  `id` bigint(20) NOT NULL,
  `adresse` varchar(255) DEFAULT NULL,
  `nom` varchar(255) DEFAULT NULL,
  `pourcentage` decimal(19,2) DEFAULT NULL,
  `prix` decimal(19,2) DEFAULT NULL,
  `solde` decimal(19,2) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `prescripteurjour` */

/*Table structure for table `prescripteurjourdetail` */

DROP TABLE IF EXISTS `prescripteurjourdetail`;

CREATE TABLE `prescripteurjourdetail` (
  `id` bigint(20) NOT NULL,
  `adresse` varchar(255) DEFAULT NULL,
  `dateEnvoie` date DEFAULT NULL,
  `dossierId` varchar(255) DEFAULT NULL,
  `interne` bit(1) DEFAULT NULL,
  `mois` varchar(255) DEFAULT NULL,
  `moisValeur` int(11) DEFAULT NULL,
  `nom` varchar(255) DEFAULT NULL,
  `patientNom` varchar(255) DEFAULT NULL,
  `pourcentage` decimal(19,2) DEFAULT NULL,
  `prix` decimal(19,2) DEFAULT NULL,
  `prixPerso` decimal(19,2) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `prescripteurjourdetail` */

/*Table structure for table `prescripteurpojo` */

DROP TABLE IF EXISTS `prescripteurpojo`;

CREATE TABLE `prescripteurpojo` (
  `id` bigint(20) NOT NULL,
  `adresse` varchar(255) DEFAULT NULL,
  `nom` varchar(255) DEFAULT NULL,
  `pourcentage` decimal(19,2) DEFAULT NULL,
  `prix` decimal(19,2) DEFAULT NULL,
  `solde` decimal(19,2) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `prescripteurpojo` */

/*Table structure for table `prescripteurpojodetail` */

DROP TABLE IF EXISTS `prescripteurpojodetail`;

CREATE TABLE `prescripteurpojodetail` (
  `idPerson` bigint(20) NOT NULL,
  `adresse` varchar(255) DEFAULT NULL,
  `dateEnvoie` date DEFAULT NULL,
  `idDossier` varchar(255) DEFAULT NULL,
  `mois` varchar(255) DEFAULT NULL,
  `moisValeur` int(11) DEFAULT NULL,
  `patientInterne` bit(1) DEFAULT NULL,
  `patientNom` varchar(255) DEFAULT NULL,
  `personNom` varchar(255) DEFAULT NULL,
  `prix` decimal(19,2) DEFAULT NULL,
  `prixPerso` decimal(19,2) DEFAULT NULL,
  PRIMARY KEY (`idPerson`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `prescripteurpojodetail` */

/*Table structure for table `reactif` */

DROP TABLE IF EXISTS `reactif`;

CREATE TABLE `reactif` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `nom` varchar(45) NOT NULL,
  `qte` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'nombre d''examen',
  `qte_critique` int(10) unsigned NOT NULL DEFAULT '0',
  `actif` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `ref_examen` int(10) unsigned DEFAULT NULL,
  `nbreExamen` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `reactif` */

/*Table structure for table `reactif_entree` */

DROP TABLE IF EXISTS `reactif_entree`;

CREATE TABLE `reactif_entree` (
  `numApprov` varchar(50) NOT NULL,
  `actif` tinyint(1) NOT NULL DEFAULT '0',
  `dateApprov` datetime NOT NULL,
  `dateMaj` datetime NOT NULL,
  `fournisseur` varchar(255) NOT NULL,
  `lock_` tinyint(1) NOT NULL DEFAULT '0',
  `Objet` longtext NOT NULL,
  `userMaj` varchar(255) NOT NULL,
  `version` int(11) NOT NULL,
  PRIMARY KEY (`numApprov`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `reactif_entree` */

/*Table structure for table `reactif_examen` */

DROP TABLE IF EXISTS `reactif_examen`;

CREATE TABLE `reactif_examen` (
  `id` varchar(6) NOT NULL,
  `actif` tinyint(1) NOT NULL DEFAULT '0',
  `dateMAJ` datetime NOT NULL,
  `ref_examen` int(11) DEFAULT NULL,
  `ref_reactif` int(11) DEFAULT NULL,
  `userMAJ` varchar(50) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `reactif_examen` */

/*Table structure for table `reactif_historique` */

DROP TABLE IF EXISTS `reactif_historique`;

CREATE TABLE `reactif_historique` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `ref_reactif` int(10) unsigned NOT NULL,
  `qte` int(10) unsigned NOT NULL,
  `motif` varchar(255) DEFAULT NULL,
  `login` varchar(45) NOT NULL,
  `date_maj` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `FK_reactif_historique_1` (`ref_reactif`),
  CONSTRAINT `FK_reactif_historique_1` FOREIGN KEY (`ref_reactif`) REFERENCES `reactif` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `reactif_historique` */

/*Table structure for table `reactif_ligne_entree` */

DROP TABLE IF EXISTS `reactif_ligne_entree`;

CREATE TABLE `reactif_ligne_entree` (
  `NumLigneApprov` varchar(55) NOT NULL,
  `Cout` decimal(12,3) NOT NULL,
  `dateDebut` datetime NOT NULL,
  `dateMaj` datetime NOT NULL,
  `NumApprov` varchar(255) NOT NULL,
  `QteApprov` int(11) NOT NULL,
  `reactif` int(11) NOT NULL,
  `userMaj` varchar(255) NOT NULL,
  PRIMARY KEY (`NumLigneApprov`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `reactif_ligne_entree` */

/*Table structure for table `reactif_ligne_sortie` */

DROP TABLE IF EXISTS `reactif_ligne_sortie`;

CREATE TABLE `reactif_ligne_sortie` (
  `NumLigne` varchar(55) NOT NULL,
  `dateDebut` datetime NOT NULL,
  `dateMaj` datetime NOT NULL,
  `NumSortie` varchar(255) NOT NULL,
  `QteSortie` int(11) NOT NULL,
  `reactif` int(11) NOT NULL,
  `userMaj` varchar(255) NOT NULL,
  PRIMARY KEY (`NumLigne`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `reactif_ligne_sortie` */

/*Table structure for table `reactif_sortie` */

DROP TABLE IF EXISTS `reactif_sortie`;

CREATE TABLE `reactif_sortie` (
  `NumSortie` varchar(50) NOT NULL,
  `actif` tinyint(1) NOT NULL DEFAULT '0',
  `dateMaj` datetime NOT NULL,
  `DateSortie` datetime NOT NULL,
  `login` varchar(45) NOT NULL,
  `numApprov` varchar(255) DEFAULT NULL,
  `objet` longtext NOT NULL,
  `type_sortie` varchar(255) DEFAULT NULL,
  `userMaj` varchar(255) NOT NULL,
  PRIMARY KEY (`NumSortie`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `reactif_sortie` */

/*Table structure for table `resultat_examen` */

DROP TABLE IF EXISTS `resultat_examen`;

CREATE TABLE `resultat_examen` (
  `num_ordre` int(10) unsigned NOT NULL,
  `ref_examen` int(10) unsigned NOT NULL,
  `fichier` longtext,
  `description` varchar(300) CHARACTER SET latin1 DEFAULT NULL,
  `resultat` int(10) unsigned NOT NULL,
  PRIMARY KEY (`num_ordre`,`ref_examen`) USING BTREE,
  KEY `FK_resultat_examen_1` (`ref_examen`),
  CONSTRAINT `FK_resultat_examen_1` FOREIGN KEY (`ref_examen`) REFERENCES `examen` (`id`)
