an><span style=\"font-family:Courier New\"></span></p>\r\n\r\n<p style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:3.0pt;margin-left:0cm;font-size:12.0pt;\"><span style=\"font-size:11.0pt;font-family:Courier New\">EXAMEN\r\nCLINIQUE</span><span style=\"font-family:Courier New\"></span></p>\r\n\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;line-height:150%\"><b><span style=\"font-size:6.0pt;\r\nline-height:150%;font-family:Courier New\">&nbsp;</span></b><span style=\"font-family:Courier New\"></span></p>\r\n\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;line-height:150%\"><b><span style=\"font-size:11.0pt;\r\nline-height:150%;font-family:Courier New\">Renseignements cliniques&nbsp;: </span></b><span style=\"font-size:8.0pt;line-height:150%;font-family:Courier New\">--------------------------------------------------------------------------</span><span style=\"font-family:Courier New\"></span></p>\r\n\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;line-height:150%\"><b><span style=\"font-size:11.0pt;\r\nline-height:150%;font-family:Courier New\">Manifestations cliniques&nbsp;:</span></b><span style=\"font-family:Courier New\"></span></p>\r\n\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;\"><span style=\"font-size:11.0pt;font-family:Courier New\">&nbsp;</span><span style=\"font-family:Courier New\"></span></p>\r\n\r\n<p style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:3.0pt;margin-left:0cm;font-size:12.0pt;text-align:center;line-height:150%\"><strong><u><span style=\"font-size:11.0pt;line-height:150%;font-family:Courier New\">RESULTATS</span></u></strong><span style=\"font-family:Courier New\"></span></p>\r\n\r\n<h6 style=\"margin:0cm;margin-bottom:.0001pt;page-break-after:avoid;font-size:12.0pt;font-family:Courier New;color:red;font-weight:normal;\"><span style=\"font-size:11.0pt;;\r\ncolor:windowtext;\">METHODE UTILISEE: IMMUNOPEROXIDASE\r\nINDIRECT (IPAzyme)</span><span></span></h6>\r\n\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;\"><span style=\"font-family:Courier New;\">&nbsp;</span><span style=\"font-family:Courier New\"></span></p>\r\n\r\n<div>\r\n\r\n<table style=\"font-size:10.0pt;border-collapse:collapse;\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\r\n <tbody><tr>\r\n  <td style=\"width:105.95pt;border:solid windowtext 1.0pt;\r\n  padding:0cm 5.4pt 0cm 5.4pt\" valign=\"top\" width=\"141\">\r\n  <p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;\"><b><span style=\"font-size:11.0pt;font-family:Courier New\">Titre\r\n  en IgG:</span></b><span style=\"font-family:Courier New\"></span></p>\r\n  </td>\r\n  <td style=\"width:445.7pt;border:solid windowtext 1.0pt;\r\n  border-left:none;padding:0cm 5.4pt 0cm 5.4pt\" valign=\"top\" width=\"594\">\r\n  <h5 style=\"margin:0cm;margin-bottom:.0001pt;page-break-after:avoid;font-size:12.0pt;font-family:Courier New;color:red;text-align:center\"><span>IgG&nbsp;&nbsp; =&nbsp;&nbsp; 64</span></h5>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td style=\"width:105.95pt;border:solid windowtext 1.0pt;\r\n  border-top:none;padding:0cm 5.4pt 0cm 5.4pt\" valign=\"top\" width=\"141\">\r\n  <h6 style=\"margin:0cm;margin-bottom:.0001pt;page-break-after:avoid;font-size:12.0pt;font-family:Courier New;color:red;font-weight:normal;\"><span style=\"font-size:11.0pt;\r\n  color:windowtext\">Validation</span><span style=\"\"></span></h6>\r\n  </td>\r\n  <td style=\"width:445.7pt;border-top:none;border-left:\r\n  none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;\r\n  padding:0cm 5.4pt 0cm 5.4pt\" valign=\"top\" width=\"594\">\r\n  <p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;text-align:center\"><span style=\"font-family:Courier New;\">&nbsp;</span><span style=\"font-family:Courier New\"></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n</div>\r\n\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;\"><span style=\"font-family:Courier New;\">&nbsp;</span><span style=\"font-family:Courier New\"></span></p>\r\n\r\n<p style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:3.0pt;margin-left:0cm;font-size:12.0pt;line-height:150%\"><span style=\"font-size:11.0pt;\r\nline-height:150%;font-family:Courier New\">INTERPRETATION</span><span style=\"font-family:Courier New\"></span></p>\r\n\r\n<ul style=\"margin-top:0cm\" type=\"disc\">\r\n <li style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;text-align:justify;tab-stops:list 36.0pt\"><span style=\"font-family:Courier New;\">Titre \r\n     &lt;8 ou immuno peroxydase\r\n     négative&nbsp;:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sérologie\r\n     négative.</span><span style=\"font-family:Courier New;\"></span></li>\r\n <li style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;text-align:justify;\r\n     tab-stops:list 36.0pt\"><span style=\"font-family:Courier New;\">Titre\r\n     compris entre 8 et 63 ou immuno peroxydase&nbsp;+ : sérologie faiblement\r\n     positive. Cette valeur ne confirme ni n’infirme une infection actuelle.\r\n     Seule l’augmentation du titre peut permettre de confirmer l’infection à\r\n     chlamydiae (à contrôler dans deux à quatre semaines).</span><span style=\"font-family:Courier New;\"></span></li>\r\n <li style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;text-align:justify;\r\n     tab-stops:list 36.0pt\"><u><span style=\"font-family:Courier New;\">Titre\r\n     compris entre 64 et 255 ou immuno peroxydase++</span></u><span style=\"font-family:Courier New;\">&nbsp;: <span style=\"color:red\">sérologie moyennement\r\n     positive.</span> Cette valeur peut correspondre à une infection active ou\r\n     une cicatrice sérologique. Faire pratiquer un 2<sup>ème</sup> examen deux\r\n     à quatre semaines plus tard.</span><span style=\"font-family:Courier New;\"></span></li>\r\n <li style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;text-align:justify;\r\n     tab-stops:list 36.0pt\"><span style=\"font-family:Courier New;\">Titre\r\n     égal ou supérieur 256 ou immuno peroxydase+++&nbsp;: sérologie fortement\r\n     positive. Cette valeur est le signe d’une infection diffuse à chlamydiae\r\n     (ex&nbsp;: salpingite, pneumopathie, LGV, épididymite, orchite …)</span><span style=\"font-family:Courier New;\"></span></li>\r\n</ul>\r\n\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;text-align:justify\"><strong><span style=\"font-family:Courier New;\">&nbsp;</span></strong><span style=\"font-family:Courier New\"></span></p>\r\n\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;text-align:justify\"><strong><span style=\"font-family:Courier New;\">N.B</span></strong><span style=\"font-family:Courier New;\">&nbsp;:\r\nLes anticorps ainsi décelés peuvent persister longtemps, même après la\r\nguérison.</span><span style=\"font-family:Courier New\"></span></p>\r\n\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;\"><span style=\"font-family:Courier New;\">&nbsp;</span><span style=\"font-family:Courier New\"></span></p>\r\n\r\n</div>\r\n','igG',2),(1,60,'<div style=\"size:595.3pt 841.9pt;margin:42.55pt 22.3pt 42.55pt 1.0cm;\">\r\n\r\n<p style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:3.0pt;margin-left:0cm;font-size:12.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;text-align:center\" align=\"center\"><span style=\"font-size:14.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">SERODIAGNOSTIQUE\r\nDES CHLAMYDIAE</span></p>\r\n\r\n<p style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:3.0pt;margin-left:0cm;font-size:12.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\"><span style=\"font-size:11.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">EXAMEN\r\nCLINIQUE</span></p>\r\n\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;line-height:150%\"><b><span style=\"font-size:6.0pt;\r\nli