ding: 0cm 3.5pt; height: 12.75pt;\" nowrap=\"nowrap\" valign=\"bottom\" width=\"35%\"> </td>\r\n<td style=\"width: 35.76%; border-width: medium 1pt 1pt medium; border-style: none solid solid none; border-color: -moz-use-text-color windowtext windowtext -moz-use-text-color; padding: 0cm 3.5pt; height: 12.75pt;\" nowrap=\"nowrap\" valign=\"bottom\" width=\"35%\"> </td>\r\n<td style=\"width: 28.48%; border-width: medium 1pt 1pt medium; border-style: none solid solid none; border-color: -moz-use-text-color windowtext windowtext -moz-use-text-color; padding: 0cm 3.5pt; height: 12.75pt;\" nowrap=\"nowrap\" valign=\"bottom\" width=\"28%\"> </td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n','Hépatite B et C',2),(1,129,'<div>\r\n\r\n<p style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:3.0pt;margin-left:0cm;font-size:12.0pt;font-family:Calibri,sans-serif;text-align:center\"><span style=\"font-size:14.0pt;font-family:Courier New\">SERODIAGNOSTIQUE\r\nDES CHLAMYDIAE</span></p>\r\n\r\n<p style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:3.0pt;margin-left:0cm;font-size:12.0pt;font-family:Calibri,sans-serif;\"><span style=\"font-size:11.0pt;font-family:Courier New\">EXAMEN CLINIQUE</span></p>\r\n\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;font-family:Courier New;line-height:150%\"><strong><span style=\"font-size:6.0pt;line-height:150%\">&nbsp;</span></strong></p>\r\n\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;font-family:Courier New;line-height:150%\"><strong><span style=\"font-size:11.0pt;line-height:150%\">Renseignements cliniques&nbsp;: </span></strong><span style=\"font-size:8.0pt;line-height:150%\">--------------------------------------------------------------------------</span></p>\r\n\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;font-family:Courier New;line-height:150%\"><strong><span style=\"font-size:11.0pt;line-height:150%\">Manifestations cliniques&nbsp;:</span></strong></p>\r\n\r\n<br clear=\"ALL\"/>\r\n\r\n<p style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:3.0pt;margin-left:0cm;font-size:12.0pt;font-family:Calibri,sans-serif;text-align:center;line-height:150%\"><strong><u><span style=\"font-size:11.0pt;line-height:150%;font-family:Courier New\">RESULTATS</span></u></strong></p>\r\n\r\n<h6 style=\"margin:0cm;margin-bottom:.0001pt;page-break-after:avoid;font-size:12.0pt;font-family:Courier New;color:red;font-weight:normal;\"><span style=\"font-size:11.0pt;font-family:Courier New;color:windowtext\">METHODE UTILISEE: IMMUNOPEROXIDASE INDIRECT (IPAzyme)</span></h6>\r\n\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;font-family:Courier New;\"><b><span style=\"font-size:11.0pt\">Titre en IgG / IgM /\r\nIgA&nbsp;:&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></b><strong><span style=\"font-size:12.0pt;font-family:Courier New;color:red\">IgG = 64</span></strong></p>\r\n\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;font-family:Courier New;\"><span style=\"font-size:11.0pt\">&nbsp;</span></p>\r\n\r\n<h6 style=\"margin:0cm;margin-bottom:.0001pt;page-break-after:avoid;font-size:12.0pt;font-family:Courier New;color:red;font-weight:normal;\"><span style=\"font-size:11.0pt;font-family:Courier New;color:windowtext\">Validation</span></h6>\r\n\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;font-family:Courier New;\">\r\n\r\n<span style=\"font-size:11.0pt\">&nbsp;</span></p><span style=\"font-size:11.0pt;line-height:150%;font-family:Courier New\">INTERPRETATION</span>\r\n\r\n<ul style=\"margin-top:0cm\" type=\"disc\">\r\n <li style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;font-family:Courier New;text-align:justify\"><span>Titre &lt;8 ou\r\n     immuno peroxydase négative&nbsp;:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sérologie négative.</span></li>\r\n <li style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;font-family:Courier New;text-align:justify\"><span>Titre compris\r\n     entre 8 et 63 ou immuno peroxydase&nbsp;+ : sérologie faiblement positive.\r\n     Cette valeur ne confirme ni n’infirme une infection actuelle. Seule\r\n     l’augmentation du titre peut permettre de confirmer l’infection à\r\n     chlamydiae (à contrôler dans deux à quatre semaines).</span></li>\r\n <li style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;font-family:Courier New;text-align:justify\"><u><span>Titre\r\n     compris entre 64 et 255 ou immuno peroxydase++</span></u><span>&nbsp;:\r\n     <span style=\"color:red\">sérologie moyennement positive.</span> Cette\r\n     valeur peut correspondre à une infection active ou une cicatrice\r\n     sérologique. Faire pratiquer un 2<sup>ème</sup> examen deux à quatre\r\n     semaines plus tard.</span></li>\r\n <li style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;font-family:Courier New;text-align:justify\"><span>Titre égal ou\r\n     supérieur 256 ou immuno peroxydase+++&nbsp;: sérologie fortement positive.\r\n     Cette valeur est le signe d’une infection diffuse à chlamydiae (ex&nbsp;:\r\n     salpingite, pneumopathie, LGV, épididymite, orchite …)</span></li>\r\n</ul>\r\n\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;font-family:Courier New;text-align:justify\"><strong><span>&nbsp;</span></strong></p>\r\n\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;font-size:10.0pt;font-family:Courier New;text-align:justify\"><strong><span>N.B</span></strong><span>&nbsp;: Les anticorps ainsi décelés peuvent persister longtemps,\r\nmême après la guérison.</span></p>\r\n\r\n</div>\r\n','SERODIAGNOSTIQUE DES CHLAMYDIAE',0),(1,131,'<div style=\"text-align: center;\">\r\n<table style=\"width: 88%; border-collapse: collapse;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr style=\"height: 12.75pt;\">\r\n<td width=\"100%\" nowrap=\"nowrap\" valign=\"bottom\" style=\"padding: 0cm 3.5pt; border: #000000; width: 100%; height: 1